import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1 style={{ color: "#004cff", fontSize: "100px" }}>인뱅</h1>
      <h2 style={{ color: "#004cff" }}>In-Bang</h2>
      <p style={{ color: "#004cff" }}>
        <br />
        Are you ready to watch exciting movies? Click the box below to get you
        started!
      </p>
      <p style={{ color: "#004cff" }}>
        <br />
        Website still under development, for more details visit
        localhost:3000/subscription
      </p>
      <Link to="/login">
        <button
          style={{
            backgroundColor: "#1200b8",
            color: "#ffffff",
            padding: "5px",
          }}
        >
          Get Started →
        </button>
      </Link>
      <div
        style={{
          display: "flex",
          justifyContent: "top-right",
          alignItems: "center",
          marginTop: "20px",
        }}
      >
        <Link to="/login">
          <button
            style={{
              backgroundColor: "#1200b8",
              color: "#ffffff",
              padding: "5px",
            }}
          >
            Login
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Homepage;
